import CustomerInfo from '../../pages/CustomerInfo';
import Home from '../../pages/Home';
import Product from '../../pages/Product';

const routes = [
  {
    path: '/',
    exact: true,
    component: Home,
    name: 'Home Page',
  },
  {
    path: '/customer',
    exact: true,
    component: CustomerInfo,
    name: 'Customer Information',
  },
  {
    path: '/product',
    exact: true,
    component: Product,
    name: 'Produkty',
  },
];

export default routes;
